`,p.jsxs(e.p,{children:["In den vorherigen Kapiteln, haben wir gelernt dass der Computer alle Daten in ",p.jsx(e.code,{children:"Bits"})," abspeichert. Sobald wir diese ",p.jsx(e.code,{children:"Bits"})," zusammen gruppieren und zu einem ",p.jsx(e.code,{children:"Byte"})," fassen, knnen wir bereits sehr viele Informationen damit reprsentieren. Das haben wir beim ",p.jsx(e.code,{children:"ASCII"}),"-Code gesehen, aber auch bei den Bildern, bei denen wir jeweils ein Pixel mit 3 Farbkanlen dargestellt haben. Wir haben also die Daten die im Computer gespeichert sind, auf eine ganz bestimmte Art und Weise ",p.jsx(e.strong,{children:"interpretiert"}),". Diese ",p.jsx(e.strong,{children:"Interpretation"})," knnen wir auf dem Computer als ",p.jsx(e.strong,{children:"Sprache"})," bezeichnen."]}),`
`,p.jsxs(e.p,{children:["Diese ",p.jsx(e.strong,{children:"Sprachen"})," knnen unterschiedlich kompliziert oder auch sehr einfach sein. Wichtig dabei ist, dass diese ",p.jsx(e.strong,{children:"Sprachen"})," immer irgendwo festgelegt sind. Der Computer verwendet diese ",p.jsx(e.strong,{children:"Sprachen"})," dann um einen Speicherblock zu ",p.jsx(e.strong,{children:"interpretieren"})," und damit etwas vernnftiges anzufangen. Ganz wichtig dabei ist, der Computer kann nicht wissen was wir meinen, und unprzise Aussagen von uns korrigieren. Der Computer kann nur ganz genau einer ",p.jsx(e.strong,{children:"Sprache"})," folgen, wie zum Beispiel dem ",p.jsx(e.code,{children:"ASCII"}),"-Code."]}),`
`,p.jsxs(Ko,{title:"ASCII vs Bild",children:[p.jsxs(e.p,{children:["Der Computer kann jeden Speicherblock mit jeder beliebigen Sprache interpretieren. Manchmal geht es sogar auf, das der gleiche Speicherblock mit verschiedenen Sprachen Sinn ergibt. Meist ist dies aber nicht der Fall. Wir schauen und als Beispiel einen Speicherblock im ",p.jsx(e.code,{children:"ASCII"}),"-Code an. Dann interpretieren wir den gleichen Speicherblock als Bild."]}),p.jsx(p6e,{}),p.jsxs(e.p,{children:["An dem Beispiel knnen Sie ganz gut erkennen, das der Computer einfach nur versucht einen Speicherblock mit der angegebenen Sprache zu ",p.jsx(e.strong,{children:"interpretieren"}),". Manchmal geht das recht gut auf, aber schon in dem Beispiel hier, funktioniert es oftmals nicht, da wir nicht immer gengend Zeichen haben, um alle Pixel zu fllen."]})]}),`
`,p.jsx(e.h2,{children:"Verschiedene Sprachen"}),`
`,p.jsxs(e.p,{children:["Es gibt unzhlige ",p.jsx(e.strong,{children:"Sprachen"})," die wir auf dem Computer verwenden knnen. Wir knnen auch unsere ganz eigene Sprache erfinden, wenn wir das mchten. Eine eigene Sprache macht allerdings nicht so viel Sinn, denn andere Personen oder Programme werden diese nicht verstehen, ausser diese Sprache wird in das neue Programm implementiert. Das wre aber ein sehr grosser Aufwand, deshalb hat man sich auf einige Standarts geeinigt, die dann als Sprachen berall verwendet werden. Ein besserer Begriff fr ",p.jsx(e.strong,{children:"Sprachen"})," wre in unserem Fall: ",p.jsx(e.strong,{children:"Dateiformat"}),". Es wirkt ein wenig merkwrdig wenn wir bei Bildern von ",p.jsx(e.strong,{children:"Sprache"})," reden, das ganze soll aber zeigen wie wichtig die ",p.jsx(e.strong,{children:"Sprachen"})," in der Informatik berhaupt sind. Hier finden Sie eine kurze Liste von ",p.jsx(e.strong,{children:"Sprachen"})," von denen wir uns einige anschauen werden."]}),`
`,p.jsxs(e.ul,{children:[`
