`,p.jsxs(e.li,{children:[p.jsx(e.code,{children:"PPM"})," (Portable Pixmap Format)"]}),`
`,p.jsxs(e.li,{children:[p.jsx(e.code,{children:"Markdown"})," (wird in Obsidian verwendet)"]}),`
`,p.jsxs(e.li,{children:[p.jsx(e.code,{children:"XML"})," (",p.jsx(e.code,{children:"HTML"})," und ",p.jsx(e.code,{children:"SVG"}),")"]}),`
`,p.jsxs(e.li,{children:[p.jsx(e.code,{children:"CSS"})," (wird verwendet um ",p.jsx(e.code,{children:"HTML"})," zu gestalten)"]}),`
