`,p.jsx(e.p,{children:"Rastergrafiken eignen sich besonders fr Fotos oder von Hand gezeichnete Bilder. Auch handschriftliche Dokumente auf dem Computer, lassen sich besser mit Rastergrafiken abbilden, da diese meistens keinen mathematischen Formen folgen. Generell ist alles was fotografiert oder eingescannt wird, besser als Rastergrafik. Auch Bilder mit sehr wenig Farbinformationen, knnen gut als Rastergrafiken abgespeichert werden."}),`
`,p.jsxs(e.p,{children:["Icons sind oftmals sehr kleine Bilder mit sehr wenig Farbinformationen. Diese bieten sich aber berhaupt nicht als Rastergrafiken an. Denn das grosse Problem bei Rastergrafiken, ist das vergrssern, oder auch verkleinern. Bei einem Bild mit sehr hoher Auflsung, kann man gut hineinzoomen, bis man die Verpixelung sehen kann. Bei Icons ist dies aber nicht der Fall, da diese meist nur ",p.jsx(e.code,{children:"16x16"})," oder ",p.jsx(e.code,{children:"32x32"})," Pixel gross sind. Sollte so ein Icon grsser angezeigt werden, wre es vllig verpixelt. Da kommen ",p.jsx(e.strong,{children:"Vektorgrafiken"})," zur Hilfe."]}),`
